import { Component } from '@angular/core';

@Component({
  selector: 'app-team-section',
  templateUrl: './team-section.component.html',
  styleUrls: ['./team-section.component.css']
})
export class TeamSectionComponent {
  router: any;


  openpayment(){
    this.router.navigate(['/pay'])
  }



}
